  ReactDOM.render(<App />, appEl);
}

const postsEl = document.getElementById("network")
if (postsEl) {
  ReactDOM.render(<PostsComponent />, postsEl);
}
const cors = require('cors');
const corsOptions ={
    origin:'http://localhost:3000', 
